  return (
    <BrowserRouter>
      <div className="App-wrapper">
        <Header/>
        <div className="content-wrapper">
          <SideBar/>
          <Route component={Profile}/>
          <Route component={Dialogs}/>
          {/* <Profile/> */}
          <Dialogs/>
        </div>
      </div>
    </BrowserRouter>

  );
}

export default App;
